import React from 'react';
import HomePage from './pages/homepage/homepage.component'
import { Switch, Route, Link } from 'react-router-dom';

import './App.css';

const HatsPage = (props) => {
  console.log(props);
  return (
    < div >
      <Link to='/hats/cap/:capId'>Caps</Link>
      <h1>
        HATS PAGE : {props.match.params.hatId}
      </h1>
    </div >)
}
const Caps = (props) => {
  console.log(props);
  return (
    < div >
      <h1>
        Caps : {props.match.params.capId}
      </h1>
    </div >)
}

function App() {
  return (
    <div>
      <Switch>
        <Route exact path='/' component={HomePage} />
        <Route exact path='/hats/:hatId' component={HatsPage} />
        <Route exact path='/hats/cap/:capId' component={Caps} />
      </Switch>
    </div>


  );
}

export default App;
